import React, {useEffect} from "react";
import * as ROSLIB from "roslib"

const TestRosBridge = () => {
    useEffect(() => {
        const script = document.createElement("script");
        script.src = "https://static.robotwebtools.org/EventEmitter2/current/eventemitter2.min.js";
        script.async = true;
        document.body.appendChild(script)
    })

    const ros = new ROSLIB.Ros();
    ros.connect('ws://localhost:9090');

    const rosTopic = new ROSLIB.Topic({
		ros : ros,
		name : '/turtle1/start',
		messageType : 'turtle_test_suite_msgs/Start'
	});

	const start = new ROSLIB.Message({
		data : 1
	});

    const sendStart = () => {
        console.log("sendStart", rosTopic, start);
		rosTopic.publish(start);
    }


    return(
        <div>
            <h1>TurtleTestSuite</h1>
            <button onclick={sendStart}>Send StartTopic</button>
        </div>    
    )
}

export default TestRosBridge;
